MICROSOFT OFFICE 2007 COMMUNICATOR.

Office Communicator 2007 is a unified communications application that helps end users be more productive by enabling them to communicate and collaborate easily with others in different locations or time zones using a range of different communication options, including instant messaging (IM), voice, desktop sharing and video. Integration with programs across the Microsoft Office system including Word, Excel, PowerPoint, OneNote, Groove, and SharePoint gives end users many different ways to communicate directly from the context of their task.

